import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress,
    MDBListGroup,
    MDBListGroupItem,
    MDBBreadcrumbItem,
    MDBBreadcrumb
} from "mdbreact";
import { useHistory } from "react-router";
import { Chart } from "react-google-charts";
import "./style.css";
import { fetchData } from '../../services/apiConfig'
import watermark from "../../assets/images/watermark.png"
export const Scan = (props: any) => {

    const SubDomainSwitch = (e:any) => {
        console.log(e);
        props.SwitchView('subdomains', e)
    }

    const token = localStorage.getItem("token");
    console.log(props)
    if (token === null || token === undefined || token.length < 0) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }
    return (
        <>
            <MDBContainer fluid className="d-flex justify-content-center" style={{ padding: "2vw", height: "90vh", alignItems: "center",
            backgroundImage: "url('https://docs.tenable.com/nessus/Content/Images/Dashboard.png')"
                }}>
                     {/* <img src={watermark} style={{ height: "90vh" }} className="img-fluid" alt="..." /> */}
                <div>
                <p style={{ fontSize: "20px", fontWeight: "bold"}}>Scanning in progress</p>
                <div className="d-flex justify-content-center">
                <MDBIcon icon="sync" spin size="2x" fixed style={{color: "#2bbbad"}}/>
                <span className="sr-only">Loading...</span>
                </div>
                </div>
            </MDBContainer>
        </>
    )
}
